setup/.body:
Required Files
After setting up your plugins composer.json file, these are the files you need to create.
Hopefully these will be available using a generator such as yeoman.
lib/Plugin.php
Reasoning: Contains immutable data.
The plugin version and name do not change throughout the request life cycle.
namespace FCG\Agenda;

/**
 * Definition of the Plugin.
 *
 * Includes name and current version but can contain other
 * immutable information like an api endpoint, etc.
 *
 * @since      0.0.1
 * @package    Gulbenkian
 * @author     Rui Sardinha 
 */
final class Plugin {

    const NAME = 'fcg-agenda';

    const VERSION = '0.0.1';

}

lib/PluginFactory.php
Design Pattern : Factory
Reasoning: Having this class allows outside usage by other plugins or themes.
namespace FCG\Agenda;

use Plugin;

/**
 * Plugin Factory
 *
 * This is the main entry point into the plugins assets.
 *
 * @since      0.0.1
 * @package    Gulbenkian
 * @author     Rui Sardinha 
 */
final class PluginFactory {

    public static function create() {

        static $app = null;

        if ( null === $app ) {
            $app = new App( Plugin::NAME, Plugin::VERSION );
        }

        return $app;
    }
}

plugin-name.php
Design Pattern : Frontend
Reasoning: Plugin entry point. Fires off the needed hooks
if ( file_exists( dirname( __FILE__ ) . '/vendor/autoload.php' ) ) {
    require_once dirname( __FILE__ ) . '/vendor/autoload.php';
}

// If this file is called directly, abort.
if ( ! defined( 'WPINC' ) ) {
    die;
}

/**
 * The code that runs during plugin activation.
 * This action is documented in src/Activator.php
 */
if ( is_callable( [ FCG\Agenda\Activator::class, 'activate' ] ) ) {
    \register_activation_hook( __FILE__, [ FCG\Agenda\Activator::class, 'activate' ] );
}

/**
 * The code that runs during plugin deactivation.
 * This action is documented in src/Activator.php
 */
if ( is_callable( [ FCG\Agenda\Activator::class, 'deactivate' ] ) ) {
    \register_deactivation_hook( __FILE__, [ FCG\Agenda\Activator::class, 'deactivate' ] );
}

/**
 * Begins execution of the plugin.
 *
 * @since    0.0.1
 */
\add_action( 'plugins_loaded', function () {
    $plugin = FCG\Agenda\PluginFactory::create();
    $plugin->run();
} );

lib/App.php
Design Pattern : Facade
Reasoning: Handles all internal plugin logic
namespace FCG\Agenda;

use \csrui\WPConstruct\Plugin\App as WPCApp;

class App extends WPCApp {

    public function run() {
        parent::run();

        // Do great things!!!
    }
}

activation/.body:
Activation Actions
Sometimes you may need to perform actions when the plugin is activated or even deactivated,
like cleaning some cache or ensuring some files exist.
Here is an example on how to verify if a file exists
namespace FCG\Agenda;

use csrui\WPConstruct\Plugin\Activator as WPCActivator;

class Activator implements WPCActivator {

    public static function activate() {

        if ( file_exists( 'README.md' ) !== true ) {
            throw new \Exception( 'Oops' );
        }

        // Do something awesome
    }

    public static function deactivate() {}
}

migrations/.body:
Migrations
Say you need some custom tables created on your WordPress database.
Using the previous chapter Activation actions we can
create tables when activating our plugin using pure SQL.
Using the following method will give you out of the box:

Versioning magic - Only run queries if plugin was updated.
Automatic prefixing based on plugin name.
No need to write the word global.

Here's how.
namespace FCG\Agenda\Migrations;

use \csrui\WPConstruct\Plugin\Migrations\Migration;

class EventsTable extends Migration {

    protected function queries() : array {

        $table_name      = $this->get_table_name( 'events' );
        $charset_collate = $this->get_charset();

        return [
            "CREATE TABLE {$table_name} (
                big_field_1 bigint(20) unsigned NOT NULL,
                big_field_2 bigint(20) unsigned NOT NULL,
                UNIQUE KEY (agenda_event_id, agenda_term_id)
            ) {$charset_collate};",
        ];
    }
}

Now we can use the an activator to create the necessary database tables
for the plugin.
namespace FCG\Agenda;

use csrui\WPConstruct\Plugin\Activator as WPCActivator;

use FCG\Agenda\Plugin;
use FCG\Agenda\Migrations\AwesomeTable;

class Activator implements WPCActivator {

    public static function activate() {

        $migration = new AwesomeTable( Plugin::NAME, Plugin::VERSION );
        $migration->run();

    }

    public static function deactivate() {}
}

